package com.techlab.thisKeyword;

class StudentInfo {
	int rollNo;
	String name;
	float fee;

	StudentInfo(int rollNo, String name, float fee) {
		this.rollNo = rollNo;
		this.name = name;
		this.fee = fee;
	}
	public int getRollNo(){
		
		return rollNo;
	}
	public String getName() {
		// TODO Auto-generated method stub
		return name;
	}
	public float getFee() {
		
		return fee;
	}

}
	
